import React from "react";

const MemberJourney = ({ journey }) => {
  if (!journey || !Array.isArray(journey.journey)) {
    return (
      <div className="p-4 bg-gray-100 rounded-lg shadow">
        <p>Loading journey...</p>
      </div>
    );
  }

  return (
    <div className="p-6 bg-white rounded-xl shadow-md">
      <h2 className="text-xl font-bold mb-4">
        Member Journey â€“ {journey.member}
      </h2>

      {journey.journey.map((episode, idx) => (
        <div key={idx} className="mb-6 border-b pb-4">
          <h3 className="text-lg font-semibold">
            Month {episode.month}: {episode.episode}
          </h3>

          <p className="text-gray-600">
            Messages: {episode.metrics.messages} | Decisions:{" "}
            {episode.metrics.decisions}
          </p>

          <ul className="list-disc list-inside mt-2 text-gray-700">
            {episode.conversations.map((conv, cidx) => (
              <li key={cidx}>
                <span className="font-semibold">{conv.sender}:</span>{" "}
                {conv.message}
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
};

export default MemberJourney;
